window.bookSummaryJSON = "<p>Trust is made to be broken.</p> <p>After returning from a successful mission to stop the Attetsian uprising, Lux and Lia find themselves under threat once again, this time at the hands of their newest ally. With the full force of King Virram's Trinity Guard set against them, they'll have to fight their way through Val if they want to keep their family safe. But with the entire country of Kaldan against them, safety will be a hard thing to find.</p>"; 
